export const SET_CUSTOMERS = 'SET_CUSTOMERS';
export const ADD_CUSTOMER = 'ADD_CUSTOMER';


function setCustomers (customers) {
    return {
        type: SET_CUSTOMERS,
        customers
    }
}

function addCustomer (customer) {
    return {
        type: ADD_CUSTOMER,
        customer
    }
}
